import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class App extends React.Component {
  constructor(props){
    super(props)
  }

  render() {
    return (
      <div>
        <input type='text' class='search'/>
        <div class="flexContainer">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
          <div>6</div>
          <div>7</div>
        </div>
      </div>
    )
  }
}


ReactDOM.render(<App />, document.getElementById('root'));
